import React from 'react'

export default class SortingVisualizer extends React.Component{
    constructor(props){
        super(props);

        this.state = {
            array: [],
        }
    }
    loadComponent(){
        this.resetArray;
    }

    resetArray(){
        const array = [];
        for(let i=0; i< 20; i++){
            array.push(Math.random()*50);
        }

    }
    
    
}
